import { View, Text, SafeAreaView } from "react-native";
import React, { useLayoutEffect } from "react";
import { useNavigation } from "@react-navigation/native";

const HomeScreen = () => {
  const navigation = useNavigation();

  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);

  return (
    <SafeAreaView class="md:mx-auto md-flex md-items-center w-screen py-5 bg-red-600">
      <View className="bg-pink-200 flex-1  w-screen md:container md:mx-auto sm:flex-row items-center py-5 h-1/3">
        <Text className="container text-center bg-gray-400 md:mx-1 sm:my-1">
          LOGO
        </Text>
        <Text className="container text-center bg-gray-400 md:mx-1 sm:my-1">
          LOGO
        </Text>
      </View>
    </SafeAreaView>
  );
};

export default HomeScreen;
